    [],nt"num_tags": 2,nt"name": "irrigation-field-trial-modoc-wildlife-refuge-april-15-1964",nt"isopen":
    false,nt"url": null,nt"notes": "During the summer of 1962 several ring
    tests were run on the Pit Series of soil for the purpose of determining intake rate.
    The results did not appear to be conclusive and the determination was made that
    a field trial should be run to more nearly determine intake rate. Difficulty was
    encountered in locating borders on typical Pit where water could be measured in
    and out. The Modoc Wildlife Refuge had a field where a trial could be run and the
    trial was set up and run on April 15.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
